import React from "react";
import logo from "../img/logo192.png";
import "./Navbar.css"
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <div className="navbar">
            <img src={logo}/>
            <ul className="nav-menu">
                <Link to="/signup">
                <li>Sign Up</li>
                </Link>
                <Link to="/signin">
                <li>Sign In</li>
                </Link>
                <Link to="/profile">
                <li>Profile</li>
                </Link>
            </ul>
        </div>
    )
}
